import React from 'react'

export function UploadPage () {
    const styles = {
        mainPage: {
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '90vh'
        },
        uploadArea: {
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '60vh',
            width: '30vw',
            backgroundColor: '#ffffff',
            borderRadius: '6px',
        }
    }
    return (
        <div style={styles.mainPage}>
            <div style={styles.uploadArea}>
                <h1>Upload Page</h1>
            </div>
        </div>
    )
}
